	this.frame_0 = function() {
		this.start = this.surfboart_start.start;
		var self=this;
		self.stop();
		
		self.start.addEventListener("click",startPlaying);
		
		function startPlaying(){
			self.gotoAndPlay(1)
		}
	}
	this.frame_1 = function() {
		
		playSound("mp3cutnet");
	}
